            'type':'text',
            'handler':handleInputChange,
            'error':errors.location,
            'label':'Location'   
        },
        {
            'name':'type',
            'type':'text',
            'handler':handleInputChange,
            'error':errors.type,
            'label':'HCP Type'   
        },
        {
            'name':'speciality',
            'type':'text',
            'handler':handleInputChange,
            'error':errors.speciality,
            'label':'Speciality'   
        },
        {
            'name':'owner',
