            'error':errors.owner,
            'label':'Ownerr/Owners'   
        },
        {
            'name':'Fyear',
            'type':'text',
            'handler':handleInputChange,
            'error':errors.name,
            'label':'Foundation Year'   
        }
    ]
    function add (){
        alert("add")
    }
    return(
        <form onSubmit={handleSubmit}>
<div className='fullName'>
              {addDoctorInput[0]}
