          <div className='acadamy_information'>
            <h3 className="title">Acadamy Information</h3> */}
              {addDoctorInput[6]}
              {addDoctorInput[7]}
              {addDoctorInput[8]}
              {addDoctorInput[9]}
              
              {addDoctorInput[10]}

          </div>
        </form>
    )

}

